import React from 'react';
import Tracklist from './Tracklist';

function SearchResults({searchResults, onAdd}){



    return (
        <div className='Track'>
            <h2>Track Name</h2>
            <Tracklist tracks={searchResults} onAdd={onAdd}></Tracklist>
        </div>
    );
}

export default SearchResults;
